import React from 'react';

const BookDetails = ({ book }) => {
  return (
    <div className="book-details">
      <h3>Book Details</h3>
      <table>
        <tbody>
          <tr>
            <td><strong>Title:</strong></td>
            <td>{book.title}</td>
          </tr>
          <tr>
            <td><strong>Author:</strong></td>
            <td>{book.author}</td>
          </tr>
          <tr>
            <td><strong>Genre:</strong></td>
            <td>{book.genre}</td>
          </tr>
        
        </tbody>
      </table>
    </div>
  );
};

export default BookDetails;
